.tk-proxima-nova-extra-condensed { font-family: "proxima-nova-extra-condensed",sans-serif; }

body {
	--fsAddBuffer: 22px;
}
[id='powerball_leaderboard_atf'],
[id='powerball_leaderboard_mid_1'],
[id='powerball_leaderboard_mid_2'],
[id='powerball_medrec_1'],
[id='powerball_medrec_2'],
[id='powerball_medrec_3'],
[id='powerball_leaderboard_btf'],
[id='powerball_leaderboard_mid_1_mobile'],
[id='powerball_leaderboard_mid_2_mobile'],
[id='powerball_mobile'],
[id='powerball_drawresults'],
[id='powerball_prizepage'] {
	display: flex;
	align-items: center;
	justify-content: center;
	flex-direction: column;
	min-height: calc(var(--height) + var(--fsAddBuffer));
	height: calc(var(--height) + var(--fsAddBuffer));
	width: 100%;
}
[id='powerball_leaderboard_atf'] {
		--height: 100px;
}
[id='powerball_leaderboard_btf'] {
		--height: 250px;
}
[id='powerball_leaderboard_mid_1_mobile'] {
		--height: 250px;
}
[id='powerball_leaderboard_mid_2_mobile'] {
		--height: 250px;
}
[id='powerball_medrec_1'] {
		--height: 250px;
}
[id='powerball_mobile'] {
		--height: 50px;
}
@media only screen and (min-width: 768px) {
	[id='powerball_drawresults'] {
		--height: 90px;
	}
	[id='powerball_mobile'] {
		display: none; 
	}
	[id='powerball_prizepage'] {
		--height: 90px;
	}
}
@media only screen and (min-width: 920px) {
	[id='powerball_leaderboard_atf'] {
		display: none; 
	}
	[id='powerball_leaderboard_btf'] {
		--height: 90px;
	}
	[id='powerball_leaderboard_mid_1'] {
		--height: 90px;
	}
	[id='powerball_leaderboard_mid_1_mobile'] {
		display: none; 
	}
	[id='powerball_leaderboard_mid_2'] {
		--height: 90px;
	}
	[id='powerball_leaderboard_mid_2_mobile'] {
		display: none; 
	}
	[id='powerball_medrec_1'] {
		--height: 280px;
	}
	[id='powerball_medrec_2'] {
		--height: 280px;
	}
	[id='powerball_medrec_3'] {
		--height: 280px;
	}
}
@media only screen and (min-width: 970px) {
	[id='powerball_leaderboard_btf'] {
		--height: 250px;
	}
	[id='powerball_leaderboard_mid_1'] {
		--height: 250px;
	}
	[id='powerball_leaderboard_mid_2'] {
		--height: 250px;
	}
}
@media only screen and (min-width: 1000px) {
	[id='powerball_prizepage'] {
		--height: 90px;
	}
}

